import Header from "./Header";
import React from "react";

const layoutStyle = {
    margin: 20,
    padding: 20,
    border: '1px solid #DDD'
}

const withLayout = (Page: React.FunctionComponent) => {
    return () => (
      <div style={layoutStyle}>
        <Header />
        <Page />
      </div>
    )
  }

  export default withLayout
